function ingredientInput() {

   



    return (

        <div className="encadrementIngredientInput">
<headers className='encadrementHeader'>
    <ul className='encadrementTete' >
    
    <img className='mascotteHeader' src={mascotteHeader} alt='' />
    <img className='titreHeader' src={LogoHeader} alt='' />
    <a href="##">
        <ol className='hedearRecette'>Toute les recettes</ol></a>
        
        <a href="##"><ol className='headerFavoris'>Mes recettes</ol></a>
   

 </ul>



        </headers>
</div>
    )
};


